import React, { Component } from "react";

class ClassExample extends Component {
  constructor(props) {
    super(props);
    this.state = {
      count: 0,
      anotherCount: 10,
    };
  }
  render() {
    return (
      <div>
        <p> you clicked from ClassExample {this.state.count} times </p>
        <button onClick={() => this.setState({ count: this.state.count + 1 })}>
          Click me
        </button>
        <button onClick={() => this.setState({ count: this.state.count + 1 })}>
          Im another! Click me
        </button>
      </div>
    );
  }
}

export default ClassExample;
